Ms. inscription: &quot;HS = Hans Schaufelein [...] vid. pag. LIX&quot;

The inscription refers to the author of the woodcut on p. LIX,  Hans Leonhard Schäufelein, whose signature often combined a shovel with his monogram.
 Hans Leonhard Schäufelein (c. 1480–1540), a German painter, designer, and wood engraver.   From about 1503 he was in Albrecht Dürer's Nuremberg workshop, entrusted with painting important projects during the master's long absences. A highly prolific printmaker, Schäufelein made most of the 150 woodcuts for a 1507 collection of New Testament passages and texts.

