Inscription: &quot;For the Rev[eran]d Mr Gay at Suffield.&quot;

I think this is in reference to Reverend Ebenezer Gay of Suffield, Connecticut, established in VIAF as <a href="http://viaf.org/viaf/26026315/#Gay,_Ebenezer,_1718-1796" rel="nofollow">Gay, Ebenezer, 1718-1796.</a>

There is at least one other Reverend Ebenezer Gay, including the Reverend Gay of Hingham (Gay, Ebenezer, 1696-1787), who was the well-known liberal minister, regarded as a father of American Unitarianism, and who was the uncle of the Gay of Suffield.

&quot;[obscured] his book. at Head Quarters on Rhode Island December 1st, 1775&quot;
I believe the obscured name reads &quot;William Barton&quot; - who was a young Captain in Richmond's regiment of Rhode Island  troops in Dec. 1775. 
William Barton (1748–1831), see <a href="http://en.wikipedia.org/wiki/William_Barton_%28soldier%29" rel="nofollow">en.wikipedia.org/wiki/William_Barton_%28soldier%29</a>

